import {cartInfo} from "../../data/cart";
const Cart =()=>{
    return(
        <div className="cart">
            <div className="cart-title">Your Shopping Cart</div>
            <div className="cart-wrapper">
                <div className="cart-items">
                    {cartInfo.map(item=>
                     <div className="cart-item"></div>
                        )}
                </div>
            </div>
            <div className="cart-prder-summary"></div>
        </div>
    );
    }
    
    export default Cart;
